import logo from './logo.svg';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Main from './layouts/Main';
import Login from './components/Login';

function App() {
  return (
    <Routes>
      <Route path='/' element={<Main />}></Route>
      <Route path='/login' element={<Login />}></Route>
    </Routes>
  );
}

export default App;
